local lib_Required = {
	["Prodiction"]	= "https://bitbucket.org/Klokje/public-klokjes-bol-scripts/raw/master/Test/Prodiction/Prodiction.lua",
	["SxOrbWalk"]	= "https://raw.github.com/Superx321/BoL/master/common/SxOrbWalk.lua",
	["VPrediction"]	= "https://raw.github.com/Ralphlol/BoLGit/master/VPrediction.lua",
}

local lib_downloadNeeded, lib_downloadCount = false, 0

function AfterDownload()
	lib_downloadCount = lib_downloadCount - 1
	if lib_downloadCount == 0 then
		lib_downloadNeeded = false
		print("<font color=\"#4c934c\">Kalista:</font> <font color=\"#FFFFFF\">Required libraries downloaded successfully, please reload (double F9).</font>")
	end
end


if _G.Reborn_Loaded or _G.AutoCarry or _G.MMA_Loaded or sacused or mmaused then
	lib_Required["SxOrbWalk"] = nil
end
	
for lib_downloadName, lib_downloadUrl in pairs(lib_Required) do
	local lib_fileName = LIB_PATH .. lib_downloadName .. ".lua"

	if FileExist(lib_fileName) then
		require(lib_downloadName)
	else
		lib_downloadNeeded = true
		lib_downloadCount = lib_downloadCount and lib_downloadCount + 1 or 1
		print("<font color=\"#4c934c\">Kalista:</font> <font color=\"#FFFFFF\">Downloading required: "..lib_downloadName..". Please reload(double F9) in 30 seconds if nothing happens and try again.</font>")
		DownloadFile(lib_downloadUrl, lib_fileName, function() AfterDownload() end)
	end
end

if lib_downloadNeeded then return end

local TESTVERSION = false
local AUTOUPDATE = true
local UPDATE_HOST = "raw.github.com"
local UPDATE_PATH = "/Ralphlol/BoLGit/master/Kalista.lua".."?rand="..math.random(1,10000)
local UPDATE_FILE_PATH = SCRIPT_PATH.."Kalista.lua"
local UPDATE_URL = "https://"..UPDATE_HOST..UPDATE_PATH

function script_Messager(message) print("<font color=\"#4c934c\"><b>Kite Machine Kalista:</font> </b><font color=\"#FFFFFF\">" .. message) end
if AUTOUPDATE then
	local ServerData = GetWebResult(UPDATE_HOST, "/Ralphlol/BoLGit/master/Kalista.version")
	if ServerData then
		ServerVersion = type(tonumber(ServerData)) == "number" and tonumber(ServerData) or nil
		if ServerVersion then
			if tonumber(version) < ServerVersion then
				script_Messager("New version available "..ServerVersion)
				script_Messager("Updating, please don't press F9")
				DelayAction(function() DownloadFile(UPDATE_URL, UPDATE_FILE_PATH, function () script_Messager("Successfully updated. ("..version.." => "..ServerVersion.."), press F9 twice to load the updated version.") end) end, 3)
			else
				script_Messager("You have got the latest version ("..ServerVersion..")")
			end
		end
	else
		script_Messager("Error downloading version info")
	end
end


